import React, { Component } from 'react'
import { Link } from 'react-router-dom'

class Header extends Component {
  render() {
    return (
      <nav style={{ textAlign: 'center' }}>
        <Link
          style={{
            marginLeft: '20px',
            textDecoration: 'none',
            color: '#eee',
            background: '#252525',
            padding: '5px',

          }}
          to="/"
        >
          Home
        </Link>
        <Link
          style={{
            marginLeft: '20px',
            textDecoration: 'none',
            color: '#eee',
            background: '#252525',
            padding: '5px',
          }}
          to="/login"
        >
          Login
        </Link>
        <Link
          style={{
            marginLeft: '20px',
            textDecoration: 'none',
            color: '#eee',
            background: '#252525',
            padding: '5px',
          }}
          to="/cadastrar"
        >
          Cadastrar
        </Link>
      </nav>
    )
  }
}

export default Header
